import React, { useState } from 'react';
import "./formStyle.css"
import { Link,useNavigate } from "react-router-dom";
//https://localhost:7079/api/User/login?username=${formData.username}&password=${formData.password} <------------login request


const LoginForm = () => {
  const  navigate=useNavigate();
  const [formData, setFormData] = useState({
    username: "",
    password: "",
  });
  const [error, setError] = useState(null);

  const handleInputChange = (event) => {
    setFormData({
      ...formData,  
      [event.target.name]: event.target.value,
    });
  };

  const handleSubmit = (event) => {
    event.preventDefault();
  
    // eslint-disable-next-line no-unused-vars
  
    const username = event.target.elements.username.value;
    const password = event.target.elements.password.value;
  
    fetch('/login', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ username, password }),
    })
      .then((response) => {
        if (!response.ok) {
          setError('Incorrect username or password.');
          throw new Error('Incorrect username or password.');
        }
  
        return response.json();
      })
      .then((data) => {
        if (data.username === 'admin') {
          navigate('/BackOffice');
        } else {
          navigate('/MainPage');
        }
      })
      .catch((error) => {
        console.error(error);
      });
  };
  return (
    <form onSubmit={handleSubmit}>
      <input
        type="text"
        name="username"
        placeholder="Username"
        value={formData.username}
        onChange={handleInputChange}
      />
      <input
        type="password"
        name="password"
        placeholder="Password"
        value={formData.password}
        onChange={handleInputChange}
      />
      <button type="submit">Login</button>
      <Link to='/RegisterForm'>Don't have an account?</Link>
      <p>temp:</p>
      <Link to='/CarGrid'>as</Link>
      <Link to='/CarsTest'>as</Link>
      <Link to='/UserList'>as</Link>

      
    </form>
  );
};

export default LoginForm;
